import React from 'react';
import "./style.css";
import { Link } from "react-router-dom";

function Contact() {
    return (
        <div className="container">
            <div className="row">
                <div className="col s12 center">
                    <h6>
                        Contact me at Github, LinkedIn, or Gmail
                    </h6>
                    links listed above
                    <h6>
                        <Link href="https://drive.google.com/file/d/1R2u1wuaLrwt9LVKeUYdi4cYio9dRVuyP/view?usp=sharing">
                            View my resume
                        </Link>
                    </h6>
                </div>
            </div>
      </div>
    )
}

export default Contact;
